import React, {Component} from 'react';
import Clock from 'react-live-clock';
import ".Clock.css";

class Time extends Component {
    render(){
        return(
            <div className='time'>
                <Clock format={'HH:mm:ss'} ticking={true} timezone={'MST'} />
             </div>
        )
    }
}

export default Time
